import React from "react";
import "../../styles/style.css";

export const ChangeImageButton = (props: string) => {
  return (
    <div className="item__body_image_changeBackward">
      <button className="item__body_image_changeBackward_button">
        {props.direction}
      </button>
    </div>
  );
};

export default ChangeImageButton;
